import {
  Card,
  CardContent,
  CardHeader,
  CardMedia,
  Divider,
} from "@material-ui/core";

export const VideoPlayerCard = () => {
  return (
    <Card>
      {/* 動画プレイヤー表示エリア */}
      {/* Drone Flying Over The Mountain Peak */}
      <CardMedia 
        component="video"
        controls
        src="/static/production ID_4763824.mp4"
      />

      {/* タイトル表示エリア */}
      <CardContent></CardContent>

      {/* タイトル下の横線 */}
      <Divider />

      {/* 投稿者情報エリア */}
      <CardHeader />

      {/* 説明文エリア */}
      <CardContent></CardContent>
    </Card>
  );
};
